import './style.css';

function App() {
  return (
    <div className="Principal">
      <h1 className='titulo'>Pesquisar por CEP</h1>
<div>
      <input className='entrada'
      placeholder='digite o seu cep'/>
      <button className='pesquisar'>
        Cep
      </button>
      </div>
      <div className='main'>
        <h2>CEP: xxxx-xxxxx</h2>
        <spa>rua</spa>
        <spa>complemento</spa>
        <spa>vila</spa>
        <spa></spa>
      </div>
    </div>
  );
}

export default App;
